        <Accordion.Body>Body content for panel 1</Accordion.Body>
      </Accordion.Item>

      <Accordion.Item eventKey="1">
        <Accordion.Header>Panel 2</Accordion.Header>

        <Accordion.Body>Body content for panel 2</Accordion.Body>
      </Accordion.Item>
    </Accordion>
  );
}
export default Education;
